import React from 'react';
import temple from '../../img/museum.png'

const middleStyle = {
    fontSize: "48px",
    paddingLeft: 420,
    backgroundColor: '#d76843',
    backgroundImage: `url(${temple})`,
    backgroundRepeat: 'no-repeat',
    backgroundPosition: '350px',
    minHeight: '410px',
}

const sectionOne = {
    fontSize: "30px",
    paddingTop: "55px",
    color: '#ffffff'
}

const sectionTwo = {
    fontSize: "24px",
    paddingBottom: "10px",
    color: '#ffffff'
}

const sectionThree = {
    fontSize: "24px",
    paddingLeft: "500px",
    color: '#ffffff'
}

const sectionFour = {
    fontSize: "24px",
    paddingTop: "100px",
    color: '#ffffff'
}

function Section(props) {
    return (
        <div style={props.section}>{props.text}</div>
    )
}

export default function Middle() {
    return (
        <div style={middleStyle}>
            <Section section={sectionOne} text={"Features"}></Section>
            <Section section={sectionTwo} text={"Features"}></Section>
            <Section section={sectionThree} text={"Features"}></Section>
            <Section section={sectionFour} text={"Features"}></Section>
        </div>
    );
}
